import React from 'react';
import TaskCard from './TaskCard';

const Table = props =>{
  console.log(props)
const taskList = props.tasks.map(element => <TaskCard tasks={element} key={element.id}/>)
  return (
    <table>
    <thead>
      <th> Task </th>
      <th> Status </th>
      <th> Due By </th>
    </thead>
    <tbody>
      {taskList}
    </tbody>
  </table>
  )
}

export default Table;
